import React, {useContext, useState} from 'react'

const AuthStatusContext = React.createContext()
const SetAuthStatusContext = React.createContext()

export function useAuthStatusContext(){
    return useContext(AuthStatusContext)
}

export function useSetAuthStatusContext(){
    return useContext(AuthStatusContext)
}

export default function AuthContext({ elements }) {
  const [isAuth, setAuthStatus] = useState(false)

  return (
    <AuthStatusContext.Provider value={isAuth}>
        <SetAuthStatusContext.Provider value={setAuthStatus}>
            {elements}
        </SetAuthStatusContext.Provider>
    </AuthStatusContext.Provider>
  )
}
